import React from 'react';
import {HeadersTextLists} from "../store/HeadersTextLists";
import TextButton from "../../text/TextButton";
import close from "../../../../image/close.svg";

function OpenMobileHeader(props) {
    const style = {
        position: 'absolute'
    }

    const positionMainFunctions = [];
    //
    const componentsList = HeadersTextLists.map((e, i) => {
        return <div key={i} style={{
            marginTop: "0.5rem",
            marginBottom:"0.2rem",
        }
        }>
            <TextButton text={e}/>
        </div>
    });
    return (
        <div className="" style={{
            position: "absolute",
            width: "100%",
            backgroundColor: "white",
            top: 0,
            textAlign: "center"
        }}>
            <div className="row flex-end header-margin" >
                <img src={close} style={{
                    width: "8%",
                }}/>
            </div>
            {componentsList}
        </div>
    );
}

export default OpenMobileHeader;
